import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 20, height: 20, viewBox: "0 0 20 20", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M10 6a1.25 1.25 0 110-2.5A1.25 1.25 0 0110 6z", fill: primaryFill }),
        React.createElement("path", { d: "M10 11.25a1.25 1.25 0 110-2.5 1.25 1.25 0 010 2.5z", fill: primaryFill }),
        React.createElement("path", { d: "M8.75 15.25a1.25 1.25 0 102.5 0 1.25 1.25 0 00-2.5 0z", fill: primaryFill }));
};
const MoreVertical20Regular = wrapIcon(rawSvg({}), 'MoreVertical20Regular');
export default MoreVertical20Regular;
